import React from 'react'

function NoteTitleForm(props) {

    const handlePatchTitle = (e) => {
        props.setNote({...props.note, title: e.target.value})
    }

    return (
        <form>
            <input onChange = {e => handlePatchTitle()} value = '' />
        </form>
    )
}

export default NoteTitleForm
